var g_multi = [1,1,1];
var g_num = [-1,-1,-1];
var g_tar = [-1,-1,-1];
var g_focus = 0;
var g_sound = true;
var g_loaded = false;

var g_isTouchDevice = ('ontouchstart' in document.documentElement || window.location.hash.charAt(1) == 'm');

var g_combos = [
  [0,0,1,1,2,2], // 1-1, 2-2, 3-3
  [0,0,1,2,2,1], // 1-1, 2-3, 3-2
  [0,1,1,0,2,2], // 1-2, 2-1, 3-3
  [0,1,1,2,2,0], // 1-2, 2-3, 3-1
  [0,2,1,1,2,0], // 1-3, 2-2, 3-1
  [0,2,1,0,2,1], // 1-3, 2-1, 3-2
];

function clickIt(n) {
  if (g_isTouchDevice && g_focus == n) {
    if (n < 3) {
      var val = g_tar[n]+1;
      chTar(n, (val >= 0 && val < 10) ? val : 0);
      playSnd(s_blip);
      return;
    } else if (n < 6) {
      var val = g_num[n-3]+1;
      chNum(n-3, (val > 0 && val < 10) ? val : 1);
      playSnd(s_blip);
      return;
    }
  }
  chFocus(n);
  playSnd(s_click);
}

function chFocus(n) {
  g_focus = n;
  var hi = document.getElementById('hi');
  switch (n) {
    case 0:
      hi.style.left = '472px';
      hi.style.top = '30px';
      hi.style.display = 'block';
      break;
    case 1:
      hi.style.left = '561px';
      hi.style.top = '30px';
      hi.style.display = 'block';
      break;
    case 2:
      hi.style.left = '650px';
      hi.style.top = '30px';
      hi.style.display = 'block';
      break;
    case 3:
      hi.style.left = '120px';
      hi.style.top = '177px';
      hi.style.display = 'block';
      break;
    case 4:
      hi.style.left = '120px';
      hi.style.top = '410px';
      hi.style.display = 'block';
      break;
    case 5:
      hi.style.left = '120px';
      hi.style.top = '643px';
      hi.style.display = 'block';
      break;
    default:
      hi.style.display = 'none';
  }
}

function getElem(n) {
  switch (n) {
    case 0:
      return document.getElementById('t0');
    case 1:
      return document.getElementById('t1');
    case 2:
      return document.getElementById('t2');
    case 3:
      return document.getElementById('n0');
    case 4:
      return document.getElementById('n1');
    case 5:
      return document.getElementById('n2');
    case 6:
      return document.getElementById('m0');
    case 7:
      return document.getElementById('m1');
    case 8:
      return document.getElementById('m2');
    default:
      return undefined;
  }
}

function resetBox() {
  g_multi = [1,1,1];
  g_num = [-1,-1,-1];
  g_tar = [-1,-1,-1];
  chFocus(0);

  for (var i = 0; i < 6; i++) {
    getElem(i).style.backgroundImage = "";
  }
  for (var i = 6; i < 9; i++) {
    getElem(i).style.backgroundImage = "url('"+i_1x+"')";
  }

  showErr(0);
}

function showErr(show) {
  var style = show ? 'block' : 'none';
  var e0 = document.getElementById('e0');
  var e1 = document.getElementById('e1');
  var e2 = document.getElementById('e2');
  if (show == 0) {
    var i = 0;
    for (i = 0; i < 3; i++) {
      if (g_num[i] == -1 || g_tar[i] == -1) {
        break;
      }
    }
    document.getElementById('codebox').style.backgroundImage = "url('"+i_codebox+"')";
    document.getElementById('batt').style.backgroundImage = (i == 3) ? "url('"+i_brdy+"')" : "";
  } else if (show == 1) {
    e0.style.top = "804px";
    e1.style.top = "804px";
    e2.style.top = "804px";
    e0.style.backgroundImage = "url('"+i_re+"')";
    e1.style.backgroundImage = "url('"+i_rr+"')";
    e2.style.backgroundImage = "url('"+i_rr+"')";
    document.getElementById('codebox').style.backgroundImage = "url('"+i_codebox+"')";
    document.getElementById('batt').style.backgroundImage = "url('"+i_berr+"')";
  } else if (show >= 2) {
    e0.style.top = "803px";
    e1.style.top = "803px";
    e2.style.top = "803px";
    e0.style.backgroundImage = "url('"+i_w[g_tar[0]]+"')";
    e1.style.backgroundImage = "url('"+i_w[g_tar[1]]+"')";
    e2.style.backgroundImage = "url('"+i_w[g_tar[2]]+"')";
    document.getElementById('codebox').style.backgroundImage = "url('"+i_res[show-2]+"')";;
    document.getElementById('batt').style.backgroundImage = "url('"+i_bok+"')";
  }
  e0.style.display = style;
  e1.style.display = style;
  e2.style.display = style;
}

function chMulti(elem, n) {
  switch (g_multi[n]) {
    case 2:
      g_multi[n] = 10;
      elem.style.backgroundImage = "url('"+i_10x+"')";
      break;
    case 10:
      g_multi[n] = 1;
      elem.style.backgroundImage = "url('"+i_1x+"')";
      break;
    default:
      g_multi[n] = 2;
      elem.style.backgroundImage = "url('"+i_2x+"')";
      break;
  }
  showErr(0);
  playSnd(s_thump);
  //console.log("g_multi["+n+"] = " + g_multi[n]);
}

function chNum(n, val) {
  if (val >= 1 && val <= 9) {
    g_num[n] = val;
    getElem(n+3).style.backgroundImage = "url('"+i_w[val]+"')";
  } else {
    g_num[n] = -1;
    getElem(n+3).style.backgroundImage = "";
  }
  showErr(0);
  //console.log("g_num["+n+"] = " + g_num[n]);
}

function chTar(n, val) {
  if (val >= 0 && val <= 9) {
    g_tar[n] = val;
    getElem(n).style.backgroundImage = "url('"+i_r[val]+"')";
  } else {
    g_tar[n] = -1;
    getElem(n).style.backgroundImage = "";
  }
  showErr(0);
  //console.log("g_tar["+n+"] = " + g_tar[n]);
}

function solveBox() {
  for (var i = 0; i < 3; i++) {
    if (g_num[i] == -1 || g_tar[i] == -1) {
      console.log("Incomplete input");
      playSnd(s_moo);
      return;
    }
  }
  var t = g_tar[0]*100 + g_tar[1]*10 + g_tar[2];
  console.log("Solving target: "+t);
  var res = -1;
  for (var i = 0; i < 6; i++) {
    if (g_num[g_combos[i][0]]*g_multi[g_combos[i][1]]+g_num[g_combos[i][2]]*g_multi[g_combos[i][3]]+g_num[g_combos[i][4]]*g_multi[g_combos[i][5]] == t) {
      res = i;
      break;
    }
  }
  if (res == -1) {
    showErr(1);
    console.log("Solve Fail");
    playSnd(s_oof);
  } else {
    showErr(2+res);
    chFocus(6);
    console.log("Solve Success: "+(g_combos[res][0]+1)+"-"+(g_combos[res][1]+1)+" "+
        (g_combos[res][2]+1)+"-"+(g_combos[res][3]+1)+" "+(g_combos[res][4]+1)+"-"+(g_combos[res][5]+1));
    playSnd(s_mlem);
  }
}

var audioArr = [];
var audioCount = 0;

function playSnd(snd) {
  if (!g_sound) {
    return;
  }
  if (typeof(Audio) === "function") {
    if (!audioArr[audioCount]) {
      audioArr[audioCount] = new Audio();
    }
    audioArr[audioCount].src = snd;
    var promise = audioArr[audioCount].play();
    if (promise) {
      promise.catch(function(e){console.warn("WARN: playSnd() "+e);});
    }
    audioCount++;
    if (audioCount > 9) { audioCount=0; }
  } else {
    console.warn("WARN: Audio() is not a function");
  }
}

window.addEventListener("keydown", function (event) {
  if (event.defaultPrevented) {
    return;
  }
  switch (event.key) {
    case "0":
    case "1":
    case "2":
    case "3":
    case "4":
    case "5":
    case "6":
    case "7":
    case "8":
    case "9":
      var k = Number(event.key);
      if (g_focus < 3) {
        chTar(g_focus, k);
        chFocus(g_focus+1);
        playSnd(s_blip);
      } else if (g_focus < 6) {
        if (k != 0) {
          chNum(g_focus-3, k);
          chFocus(g_focus+1);
          playSnd(s_blip);
        }
      }
      break;
    case "Q":
    case "q":
      chMulti(getElem(6), 0);
      break;
    case "W":
    case "w":
      chMulti(getElem(7), 1);
      break;
    case "E":
    case "e":
      chMulti(getElem(8), 2);
      break;
    case "Backspace":
      if (g_focus < 3) {
        if (g_tar[g_focus] != -1) {
          chTar(g_focus, -1);
        }
      } else if (g_focus < 6) {
        if (g_num[g_focus-3] != -1) {
          chNum(g_focus-3, -1);
        }
      }
      if (g_focus > 0) {
        chFocus(g_focus-1);
      }
      playSnd(s_swish);
      break;
    case " ":
    case "Spacebar":
    case "Enter":
      solveBox();
      break;
    case "Delete":
    case "Del":
      resetBox();
      playSnd(s_swish);
      break;
    case "ArrowLeft":
      if (g_focus > 0) {
        clickIt(g_focus-1);
      } else {
        clickIt(5);
      }
      break;
    case "Tab":
    case "ArrowRight":
      if (g_focus > 4) {
        clickIt(0);
      } else {
        clickIt(g_focus+1);
      }
      break;
    case "ArrowUp":
      if (g_focus > 3) {
        clickIt(g_focus-1);
      } else if (g_focus == 3) {
        clickIt(0);
      } else {
        clickIt(5);
      }
      break;
    case "ArrowDown":
      if (g_focus > 4) {
        clickIt(0);
      } else if (g_focus > 2) {
        clickIt(g_focus+1);
      } else {
        clickIt(3);
      }
      break;
    default:
      return;
  }

  //console.log("g_focus = " + g_focus);

  event.preventDefault();
}, true);

var outer = document.getElementById('codebox'),
    wrapper = document.getElementById('wrap'),
    maxWidth  = 1213, // outer.clientWidth
    maxHeight = 937; // outer.clientHeight
resize();
window.addEventListener("resize", resize);
function resize() {
  var scale, width = window.innerWidth, height = window.innerHeight,
      isMax = width >= maxWidth && height >= maxHeight;

  scale = Math.min(width/maxWidth, height/maxHeight);
  outer.style.transform = isMax?'':'scale(' + scale + ')';
  wrapper.style.width = isMax?'':maxWidth * scale + 'px';
  wrapper.style.height = isMax?'':maxHeight * scale + 'px';
}

resetBox();
</script>
